import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Register from "./components/Register";



function App() {
  return (
    <div className="App">
    <Router>
      <Switch>
        <Route path='/' component={Register}/>
      </Switch>
    </Router>
    </div>
  );
}

export default App;
